class SystemAdminSettingsComponent {
    constructor(toastr, storage, router, administrationService, translate) {
        this.toastr = toastr;
        this.storage = storage;
        this.router = router;
        this.administrationService = administrationService;
        this.translate = translate;
        this.selectSettingsTab = true;
        this.model = {};
        this.active = true;
        this.showProgress = false;
        this.languagesList = [{ text: "English", value: "English" }, { text: "Arabic", value: "Arabic" }];
        this.enableMyAccountBtn = false;
    }
    ngOnInit() {
        this.showProgress = true;
        let thisComponent = this;
        this.administrationService.getSystemSetting()
            .subscribe(function (response) {
            thisComponent.model = response;
        }, function (error) {
            thisComponent.toastr.error(error, '');
            thisComponent.showProgress = false;
        }, function () {
            thisComponent.showProgress = false;
        });
        let userType = this.storage.retrieve("UserType");
        if (userType != undefined && userType == "SysAdmin")
            this.enableMyAccountBtn = true;
    }
    onSubmit() {
        this.showProgress = true;
        let thisComponent = this;
        this.administrationService.updateSystemSetting(this.model)
            .subscribe(function (response) {
            thisComponent.model = response;
            let msg = thisComponent.translate.instant("SavedSuccessfully");
            thisComponent.toastr.success(msg, '');
        }, function (error) {
            //console.log("Error happened" + error)
            thisComponent.toastr.error(error, '');
            thisComponent.showProgress = false;
        }, function () {
            thisComponent.showProgress = false;
        });
    }
    cancel() {
        this.ngOnInit();
    }
    selectLanguage(value) {
        this.model.language = value;
    }
}
